	mov r12, #31

border_loop:

	mov r0, r4
	mov r1, r5
	bl mov_cursor

	ldr r0, ptr_to_border
	bl set_color		; set_color: basically printing the color ANSI seq
	ldr r0, ptr_to_border
	add r0, r0, #1
	bl output_string

	ldr r0, ptr_to_up_all
	bl output_string
	ldr r0, ptr_to_left_all
	bl output_string

	sub r12, r12, #1
	add r5, r5, #1
	cmp r12, #0
	bne border_loop

	ldr r0, ptr_to_up_all
	bl output_string
	ldr r0, ptr_to_left_all
	bl output_string

 	pop {r4-r12,lr}
	MOV pc,lr

;================================================================



	.end
